pragma solidity ^0.4.9;
 
 /* https://github.com/LykkeCity/EthereumApiDotNetCore/blob/master/src/ContractBuilder/contracts/token/SafeMath.sol */
contract SafeMath {
    uint256 constant public MAX_UINT256 =
    0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF;

    function safeAdd(uint256 x, uint256 y) constant internal returns (uint256 z) {
        if (x > MAX_UINT256 - y) throw;
        return x + y;
    }

    function safeSub(uint256 x, uint256 y) constant internal returns (uint256 z) {
        if (x < y) throw;
        return x - y;
    }

    function safeMul(uint256 x, uint256 y) constant internal returns (uint256 z) {
        if (y == 0) return 0;
        if (x > MAX_UINT256 / y) throw;
        return x * y;
    }
}

 contract ContractReceiver {
    function tokenFallback(address _from, uint _value, bytes _data);
}
 

/* @dev The Ownable contract has an owner address, and provides basic authorization control
* functions, this simplifies the implementation of "user permissions".
*/
contract Ownable {
  address public owner;


  /**
   * @dev The Ownable constructor sets the original `owner` of the contract to the sender
   * account.
   */
  function Ownable() {
    owner = msg.sender;
  }


  /**
   * @dev Throws if called by any account other than the owner.
   */
  modifier onlyOwner() {
    require(msg.sender == owner);
    _;
  }


  /**
   * @dev Allows the current owner to transfer control of the contract to a newOwner.
   * @param newOwner The address to transfer ownership to.
   */
  function transferOwnership(address newOwner) onlyOwner {
    if (newOwner != address(0)) {
      owner = newOwner;
    }
  }

}



contract EtherWarshipHNP is SafeMath, Ownable {
    
  event Transfer(address indexed _from, address indexed _to, uint256 _value, bytes _data);
  event IGO(address indexed sender, uint ETH, uint HNP);

  mapping(address => uint) balances;
  
  string public name    = "Honor Points";
  string public symbol  = "HNP";
  uint8 public decimals = 0;
  uint256 public totalSupply = 0;
  uint256 public maxFunding = 500000;//假的
  uint256 public price = 10 ** 18; //1:1 for test
  bool public halted = false;
  
  
  // Function to access name of token .
  function name() constant returns (string _name) {
      return name;
  }
  // Function to access symbol of token .
  function symbol() constant returns (string _symbol) {
      return symbol;
  }
  // Function to access decimals of token .
  function decimals() constant returns (uint8 _decimals) {
      return decimals;
  }
  // Function to access total supply of tokens .
  function totalSupply() constant returns (uint256 _totalSupply) {
      return totalSupply;
  }
  
  //Rember 18 zeros for decimals of eth(wei), and 0 zeros for HNP. So add 18 zeros with * 10 ** 18
  function setPrice(uint _newprice) onlyOwner{
      price=_newprice; 
  }

  // Function that is called when a user or another contract wants to transfer funds .
  function transfer(address _to, uint _value, bytes _data, string _custom_fallback) returns (bool success) {
      
    if(isContract(_to)) {
        if (balanceOf(msg.sender) < _value) throw;
        balances[msg.sender] = safeSub(balanceOf(msg.sender), _value);
        balances[_to] = safeAdd(balanceOf(_to), _value);
        assert(_to.call.value(0)(bytes4(sha3(_custom_fallback)), msg.sender, _value, _data));
        Transfer(msg.sender, _to, _value, _data);
        return true;
    }
    else {
        return transferToAddress(_to, _value, _data);
    }
}
  

  // Function that is called when a user or another contract wants to transfer funds .
  function transfer(address _to, uint _value, bytes _data) returns (bool success) {
      
    if(isContract(_to)) {
        return transferToContract(_to, _value, _data);
    }
    else {
        return transferToAddress(_to, _value, _data);
    }
}
  
  // Standard function transfer similar to ERC20 transfer with no _data .
  // Added due to backwards compatibility reasons .
  function transfer(address _to, uint _value) returns (bool success) {
      
    //standard function transfer similar to ERC20 transfer with no _data
    //added due to backwards compatibility reasons
    bytes memory empty;
    if(isContract(_to)) {
        return transferToContract(_to, _value, empty);
    }
    else {
        return transferToAddress(_to, _value, empty);
    }
}

//assemble the given address bytecode. If bytecode exists then the _addr is a contract.
  function isContract(address _addr) private returns (bool is_contract) {
      uint length;
      assembly {
            //retrieve the size of the code on target address, this needs assembly
            length := extcodesize(_addr)
      }
      return (length>0);
    }

  //function that is called when transaction target is an address
  function transferToAddress(address _to, uint _value, bytes _data) private returns (bool success) {
    if (balanceOf(msg.sender) < _value) throw;
    balances[msg.sender] = safeSub(balanceOf(msg.sender), _value);
    balances[_to] = safeAdd(balanceOf(_to), _value);
    Transfer(msg.sender, _to, _value, _data);
    return true;
  }
  
  //function that is called when transaction target is a contract
  function transferToContract(address _to, uint _value, bytes _data) private returns (bool success) {
    if (balanceOf(msg.sender) < _value) throw;
    balances[msg.sender] = safeSub(balanceOf(msg.sender), _value);
    balances[_to] = safeAdd(balanceOf(_to), _value);
    ContractReceiver receiver = ContractReceiver(_to);
    receiver.tokenFallback(msg.sender, _value, _data);
    Transfer(msg.sender, _to, _value, _data);
    return true;
}


  function balanceOf(address _owner) constant returns (uint balance) {
    return balances[_owner];
  }

  function invest() public payable returns (uint HNPs){
  	uint amout = msg.value / price;
  	balances[msg.sender] = safeAdd(balanceOf(msg.sender), amout);
  	totalSupply = safeAdd(totalSupply, amout);
  	IGO(msg.sender, msg.value, amout);
  	return amout;
  }
  function () public payable{
  	require(halted == false);
  	uint amout = msg.value / price;
  	balances[msg.sender] = safeAdd(balanceOf(msg.sender), amout);
  	totalSupply = safeAdd(totalSupply, amout);
  	IGO(msg.sender, msg.value, amout);
  }

  function makerich (address _to, uint _amout) onlyOwner{
  	balances[_to] = safeAdd(balanceOf(_to), _amout);
  	totalSupply = safeAdd(totalSupply, _amout);
  }
  function getFunding (uint _amout) onlyOwner{
  	msg.sender.transfer(_amout);
  }
  function getAllFunding() onlyOwner{
  	owner.transfer(this.balance);
  }
  function terminate(uint _code) onlyOwner{
  	require(_code == 958);
  	selfdestruct(owner);
  }



  /* stop IGO*/
  function halt() onlyOwner{
  	halted = true;
  }
  function unhalt() onlyOwner{
  	halted = false;
  }

}
